import React from 'react';
import { NavLink } from 'react-router-dom'; // If you are using React Router
import styles from './Navbar.module.css';

const Navbar = () => {
  const handleLogout = () => {
    // Remove the JWT from local storage
    localStorage.removeItem('jwtToken');

    // Update the state to reflect that the user is logged out
    setIsAuthenticated(false);

    // Redirect the user to the login page or any other page
    navigate('/login'); // Replace '/login' with the appropriate path
  };

  return (
    <nav className={styles.navbar}>
      <div className={styles.navbar_inner}>
        <div className={styles.logo}>
          RetroCraft Hub
        </div>
        <ul className={styles.nav_links}>
          <li>
            <NavLink to="/dashboardfreelancer" activeclassname={styles.active}>
              Dashboard
            </NavLink>
          </li>
          <li>
            <NavLink to="/jobs" activeclassname={styles.active}>Jobs</NavLink>
          </li>
          <li>
            <NavLink to="/profilefreelancer" activeclassname={styles.active}>Profile</NavLink>
          </li>
          <li className={styles.notification_icon}>
            <span role="img" aria-label="Notification Icon">
              ðŸ””
            </span>
          </li>
          <li className={styles.notification_icon}>
            <button>Logout</button>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
